import Tabs from './Tabs'


export default function TabTest(){

    function onChange(currId){
        console.log(currId);
    }

    const tabsContent=[
        {
            label:'Tab 1',
            content:<div>This is Tab 1</div>
        },
        {
            label:'Tab 2',
            content:<div>This is Tab 2</div>
        },
        {
            label:'Tab 3',
            content:<div>This is Tab 3</div>
        },
    ]

    return <Tabs tabsContent={tabsContent} onChange={onChange} />
}
